import './App.css';

// components
import Header from './components/Header';
import TodoForm from './components/TodoForm';
import Todos from './components/Todos';
import Slideshow from './components/Slideshow';


function App() {

  const images = [
    '.image',
    'path/to/image2.jpg',
    'path/to/image3.jpg'
    // ... more images
];

  return (
    <div>
      <Header />
      <TodoForm />
      <Todos />
      <Slideshow images={images} />
    </div>
  );
}

export default App;
